require(['lodash'], function(_){
    var methods = {};
    var check = {};
    var anim = {};
    var descriptions = getDescriptions();
    console.log('descriptions:   ', descriptions);
    var states = API.getVariable('states').getValue();
    var svgmodifier = getBaseModifier();
    var indexMap = getIndexMap();
    var actions = getActions();



    // ========================================
    // Check functions
    // ========================================
    check.replaceMouse = function(action) {
        return !states[action.source].isAlive;
    };

    check.replaceMix = function(action) {
        return action.source === action.dest;
    };

    check.replaceMouse = function(action) {
        return action.source === action.dest;
    };

    check.mixToMix = function(action) {
        return action.source !== action.dest;
    };

    check.mixToMouse = function(action){
        return states[action.dest].isAlive;
    };

    function getType(id) {
        switch(id) {
            case 'mix2':
            case 'mix1':
                return 'mix';
            case 'mouse-left':
            case 'mouse-right':
            case 'mouse-center':
                return 'mouse';
            case 'becher-virulent':
            case 'becher-non-virulent':
                return 'becher';
            default:
                return id;
        }
    }

    function getAllIds() {
        return [
            'horloge',
            'becher-virulent',
            'becher-non-virulent',
            'mouse-left',
            'mouse-center',
            'mouse-right',
            'bec',
            'mix1',
            'mix2'
        ];
    }

    function getAllIdsByType(type) {
        var r = [];
        var ids = getAllIds();
        for(var i=0; i<ids.length; i++) {
            if(getType(ids[i]) === type) r.push(ids[i]);
        }
        return r;
    }

    function getActionList(source) {
        var act = _.cloneDeep(actions);
        act = filterActionSource(act, source);
        act = filterActionDest(act, source);
        act = filterActionDuplicates(act, source);
        act = filterActionState(act, source);
        act = filterActionTemplate(act, source);
        act = filterActionHighlight(act, source);

        if(act.length === 0) {
            act.push({
                label: 'Pas d\'actions disponibles',
                action: 'noAction',
                source: source
            });
        }
        return act;
    }

    function filterActionSource(actions, source) {
        for(var i=0; i<actions.length; i++) {
            if(actions[i].source !== source && getType(source) === actions[i].source) {
                actions[i].source = source;
            }
            else if(actions[i].source !== source) {
                delete actions[i];
            }
        }
        return _.compact(actions);
    }

    function filterActionDest(actions) {
        for(var i=0; i<actions.length; i++) {
            if(getType(actions[i].dest) === actions[i].dest) {
                var destinations = getAllIdsByType(actions[i].dest);
                destinations = destinations.map(function(d) {
                    var x = _.cloneDeep(actions[i]);
                    x.dest = d;
                    return x;
                });
                actions[i] = destinations;
            }
        }

        actions = _.flatten(actions);
        return actions;
    }

    function filterActionDuplicates(actions) {
        return  _.uniq(actions, function(action) {return action.source + action.dest + action.action});
    }

    function filterActionState(actions) {
        for(var i=0; i<actions.length; i++) {
            _.filter(actions)
        }
        return _.filter(actions, function(action) {
            if(!check[action.check]) return true;
            return check[action.check](action);
        });
    }

    function filterActionTemplate(actions) {
        for(var i=0; i<actions.length; i++) {
            if(actions[i].label) {
                var obj = {
                    source: states[actions[i].source],
                    dest: states[actions[i].dest]
                };
                actions[i].label = _.template(actions[i].label, obj);
            }
        }
        return actions;
    }

    function filterActionHighlight(actions) {
        for(var i=0; i<actions.length; i++) {
            actions[i]._highlight = actions[i].dest;
        }
        return actions;
    }

    function getBaseModifier() {
        var r = getAllIds().map(function(val){
            console.log('description', descriptions[val]);
            return {
                selector: '#'+val,
                info: {
                    id: val,
                    kind: 'fromsvg',
                    description: descriptions[val] || ''
                },
                _highlight: val
            };
        });
        console.log('modifer :', r);
        return r;
    }

    function getIndexMap() {
        var r = {};
        for(var i=0; i<svgmodifier.length; i++) {
            r[svgmodifier[i].info.id] = i;
        }
        return r;
    }


    // ==================================================
    // Var getters
    // ==================================================
    function getDescriptions() {
        var desc = {
            mouse: "Une <strong>souris</strong>. Vrifie tes hypothses en lui injectant une solution que tu a prpar.",
            mix: "Une <strong>solution</strong>. A la base cette solution ne contient pas de bactries. Effectue un mlange  partir des prparations de bases et d'autres solutions que tu a prpar.",
            bec: "Un <strong>bec benzne</strong>, pour chauffer tes solutions. Cela tuera toutes les bactries  l'intrieur.",
            "becher-virulent": "Un becher contenant une souche de bactries virulentes.",
            "becher-non-virulent": "Un becher contenant une souche de bactries non-virulentes"
        };

        var ids = getAllIds();
        var d = {};
        for(var i=0; i<ids.length; i++) {
            d[ids[i]] = {
                type: 'html',
                value: '<div style="font-size: 14px";>' + (desc[getType(ids[i])] || '') + ((ids[i] === getType(ids[i])) ? '' : (desc[ids[i]] || '')) + '</div>'
            };
        }
        return d;
    }

    function getActions() {
        return [
            {
                source: 'becher',
                dest: 'mouse',
                label: "Injecter <%- source.name %>  <%- dest.name %>",
                action: "becherToMouse",
                check: "becherToMouse"
            },
