                check: 'mixToMouse',
                action: 'mixToMouse'
            },
            {
                source: 'mix',
                dest: 'mix',
                label: 'Verser <%- source.name %> dans <%- dest.name %>',
                check: 'mixToMix',
                action: 'mixToMix'
            },
            {
                source: 'mix',
                dest: 'mix',
                label: 'Remplacer <%- source.name %>',
                check: 'replaceMix',
                action: 'replaceMix'
            },
            {
                source: 'bec',
                dest: 'mix',
                label: "Chauffer <%- dest.name %> avec le <%- source.name %>",
                check: "heatMix",
                action: "heatMix"
            },
            {
                source: 'horloge',
                dest: 'horloge',
                label: 'Attendre que les cellules se dveloppent en culture...',
                check: 'grow',
                action: 'grow'
            },
            {
                source: 'mouse',
                dest: 'mouse',
                label: 'Remplacer <%- source.name %>',
                action: 'replaceMouse',
                check: 'replaceMouse'
            }
        ];
    }

// ======================================================
// Initialize
// ======================================================

// Initialize
    if(!value) {
        // First execution... Send the base modifier to the svg so that it responds to actions
        API.createData('svgmodifier', getBaseModifier());
    }

    else {
