        switch(value.source) {
            case "becher-non-virulent":
                states[value.dest].hasNonVirulent = true;
                anim.becherToMix(value);
                break;
            case "becher-virulent":
                states[value.dest].hasVirulent = true;
                anim.becherToMix(value);
                break;
        }
