        if(states[value.source].hasVirulent) {
            states[value.dest].isAlive = false;
            updateMouseView(value.dest);
        }
    };



    methods.mixToMix = function(value) {
        ["hasVirulent", "hasVirulentDead", "hasNonVirulent", "hasNonVirulentDead"].forEach(function(prop) {
            states[value.dest][prop] = states[value.dest][prop] || states[value.source][prop];
        });
        anim.mixToMix(value);
    };

    methods.replaceMix = function(value) {
        ["hasVirulent", "hasVirulentDead", "hasNonVirulent", "hasNonVirulentDead"].forEach(function(prop) {
            states[value.dest][prop] = false;
        });
    };

    methods.heatMix = function(value) {
        if(states[value.dest].hasVirulent) {
            states[value.dest].hasVirulent = false;
            states[value.dest].hasVirulentDead = true;
        }
        if(states[value.dest].hasNonVirulent) {
            states[value.dest].hasNonVirulent = false;
            states[value.dest].hasNonVirulentDead = true;
        }
        anim.heatMix(value);
    };

